INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1, 1, '2017-09-15 17:50:16', 'Magento Open Source 1.9.3.6 and SUPEE-10266 Security Enhancements – 9/14/2017', 'Magento Open Source 1.9.3.6 and SUPEE-10266 include critical security enhancements. Please update your site as soon as possible. More information is available in the release notes: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html.\n', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 1, 1),
(2, 1, '2017-11-29 19:06:29', 'Magento Open Source 1.9.3.7 Enhances Security - 11/28/2017', 'Magento Open Source 1.9.3.7 includes critical security enhancements. We encourage you to upgrade or patch as soon as is reasonably possible. Review the release notes for more information: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html\n\n', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 1, 1),
(3, 4, '2017-12-12 20:00:13', 'Magento Open Source 2.2.2 Accelerates Growth with Instant Purchase Checkout, Integrated Email Marketing Automation, Advanced Reporting, and More – 12/12/2017', 'Our newest release of Magento Open Source equips merchants with powerful tools to accelerate growth and improve operational efficiency. It boosts conversion rates with a streamlined Instant Purchase checkout, jump-starts sales with integrated dotmailer email marketing automation, delivers actionable insights through Advanced Reporting, and provides integrated multi-carrier shipping and fulfillment capabilities with Magento Shipping. https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ', 'https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ', 1, 1),
(4, 4, '2018-01-31 00:18:07', 'Are you a Magento Developer? Please participate in our developer survey. ', 'As a Magento developer, your feedback is critical to the success of the Magento platform. We invite you to complete a survey about your experience developing on the Magento 2 platform. The results will help us improve our product and services to enable your continued success. The survey should take no more than 10 minutes to complete and the information you provide will remain strictly confidential. \n\nThanks in advance for your participation. \n\nhttps://www.surveymonkey.com/r/X3KHNV3', 'https://www.surveymonkey.com/r/X3KHNV3', 0, 1),
(5, 4, '2018-01-31 12:22:41', 'SMTP Pro was installed successfully.', 'SMTP Pro has been installed successfully. Go to the system configuration section of your Magento admin to configure SMTP Pro and get it up and running.', 'https://github.com/aschroder/Magento-SMTP-Pro-Email-Extension', 0, 1),
(6, 4, '2018-02-07 13:57:07', 'New Magento Security Scan Tool is available!', 'Magento has rolled out a new security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. Our  goal is to assist in ensuring the on-going security of your Magento sites. \n\nSecurity Scan is a free service of Magento, and provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. In addition, you\'ll receive real-time security status of your Magento sites and how to fix potential vulnerabilities.\n\nYou and your team, including authorized developers, can access the new tool directly within your Magento Account. And it is very easy to set up. \n\nTo learn more about the Security Scan Tool, \nlog into your Magento Account at https://account.magento.com/customer/account/.\n\nMy Account > Security Scan', 'https://account.magento.com/customer/account/', 0, 1),
(7, 1, '2018-02-27 19:45:55', 'Magento Open Source 1.9.3.8 and SUPEE-10570 Enhance Security and Functionality – 2/27/2018', 'Magento Open Source 1.9.3.8 and the SUPEE-10570 patch include critical security enhancements and feature updates, including support for recent USPS API changes. Review the release notes for more information: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html ', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0);

