(140, 2, 1, 'CDFLEX|Nenhum|Cadeira Dobrável Espaçosa|Cadeira Dobrável - Simplesmente TOP. Design exclusivo e moderno. Projetada pensando no conforto, resistência e alta durabilidade. Muito mais confortável, resistente e durável que as cadeiras de madeira e de plástico. O melhor custo beneficio em qualidade, durabilidade e resistência do mercado! Peso suportado 200kg Peso aproximado da cadeira 4kg. Medida da embalagem: altura 99cm, Largura 10cm, Comprimento 53cm. Estrutura em aço com pintura poliester eletrostática, garantindo a alta durabilidade e resistência em todos os tipos de ambientes! Assentos e encosto de Polipropileno garantindo a alta resistência e durabilidade mesmo exposto ao sol diariamente. Sem dúvida, a melhor cadeira do mercado brasileiro! Temos nas cores Branca, Preta e marrom. Consulte outras cores. Simplesmente TOP! Observações Finais: - Qualidade de exportação. - Ótima opção para bares, restaurantes que precisam abrir e fechar todos os dias suas cadeiras.... produto projetado para isso! - Durabilidade em relação as cadeiras de madeira é incomparável. Não tem as folgas e desgaste que ocorre na madeira ficando frouxas e molengas. - Segurança: Muito mais seguro que as cadeiras de plásticos, que vez por outra, quebra as pernas ou temos que ficar imóvel na cadeira para não quebrar e até o risco de uma pessoa se machucar. Isso jamais acontece em nossas cadeiras. - Conforto em relação as cadeiras de madeira é incomparável. Não dá dor nas costas e no corpo como acontece nas cadeiras de madeira por ficar numa postura inadequada e ser duro o assento e não ter curvatura no encosto. - Preço: Levando em consideração qualidade, durabilidade, segurança e conforto, o custo beneficio que há, sem dúvida, essa é a melhor opção! - Nossa empresa tem quase 20 anos de mercado. Realizamos vendas pelo BNDES, FINAME.|Cadeira Dobrável. Design exclusivo e moderno. Projetada pensando no conforto, resistência e alta durabilidade. Peso suportado 200kg Peso aproximado da cadeira 4kg. Estrutura em aço com pintura poliester eletrostática. Assentos e encosto de Polipropileno.|125|1'),
(141, 3, 1, 'MD70X70|Nenhum|Mesa dobrável 70x70|Mesa dobrável nas medidas de 70x70 Estrutura em aço com pintura poliester eletrostática garantindo a alta durabilidade e resistência em ambientes abertos. O tampo da mesa em MDF. Sistema de abertura e fechamento suave, seguro, rápido e prático que não há risco de prender a mão e se machucar como no caso de mesas de madeiras e de ferro. Muito mais resistente e durável que mesas e cadeiras de plásticos. Indicado para todos os tipos de ambientes. (Bares, restaurantes, sorveterias, residências, camping...) Cores branco, preto ou marrom. Consulte outras cores. Observações Finais: - Qualidade de exportação. - Ótima opção para bares, restaurantes que precisam abrir e fechar todos os dias suas mesas.... produto projetado para isso! - Durabilidade em relação as mesas de madeira é incomparável. Não tem as folgas e desgaste que ocorre nas mesas de madeira ficando frouxas e molengas. - Nossa empresa tem quase 20 anos de mercado. Realizamos vendas pelo BNDES, FINAME.|Mesa dobrável 70x70. Estrutura em aço com pintura poliester eletrostática. O tampo da mesa em MDF. Sistema de abertura e fechamento suave, seguro, rápido e prático. Resistente e durável. Várias cores.|139.9|1');

