(1, 4, 72, 0, 1, 'teste'),
(2, 4, 73, 0, 1, 'teste'),
(3, 4, 83, 0, 1, NULL),
(4, 4, 106, 0, 1, NULL),
(11, 4, 72, 0, 2, 'Cadeira Dobrável - Simplesmente TOP.\r\nDesign exclusivo e moderno.\r\nProjetada pensando no conforto, resistência e alta durabilidade.\r\nMuito mais confortável, resistente e durável que as cadeiras de madeira e de plástico.\r\nO melhor custo beneficio em qualidade, durabilidade e resistência do mercado!\r\nPeso suportado 200kg\r\nPeso aproximado da cadeira 4kg.\r\nMedida da embalagem: altura 99cm, Largura 10cm, Comprimento 53cm.\r\nEstrutura em aço com pintura poliester eletrostática, garantindo a alta durabilidade e resistência em todos os tipos de ambientes!\r\nAssentos e encosto de Polipropileno garantindo a alta resistência e durabilidade mesmo exposto ao sol diariamente.\r\nSem dúvida, a melhor cadeira do mercado brasileiro!\r\nTemos nas cores Branca, Preta e marrom. Consulte outras cores.\r\nSimplesmente TOP!\r\n\r\nObservações Finais:\r\n\r\n- Qualidade de exportação.\r\n\r\n- Ótima opção para bares, restaurantes que precisam abrir e fechar todos os dias suas cadeiras.... produto projetado para isso!\r\n\r\n- Durabilidade em relação as cadeiras de madeira é incomparável. Não tem as folgas e desgaste que ocorre na madeira ficando frouxas e molengas.\r\n\r\n- Segurança: Muito mais seguro que as cadeiras de plásticos, que vez por outra, quebra as pernas ou temos que ficar imóvel na cadeira para não quebrar e até o risco de uma pessoa se machucar. Isso jamais acontece em nossas cadeiras.\r\n\r\n- Conforto em relação as cadeiras de madeira é incomparável. Não dá dor nas costas e no corpo como acontece nas cadeiras de madeira por ficar numa postura inadequada e ser duro o assento e não ter curvatura no encosto.\r\n\r\n- Preço: Levando em consideração qualidade, durabilidade, segurança e conforto, o custo beneficio que há, sem dúvida, essa é a melhor opção!\r\n\r\n- Nossa empresa tem quase 20 anos de mercado. Realizamos vendas pelo BNDES, FINAME.'),
(12, 4, 73, 0, 2, 'Cadeira Dobrável.\r\nDesign exclusivo e moderno.\r\nProjetada pensando no conforto, resistência e alta durabilidade.\r\nPeso suportado 200kg\r\nPeso aproximado da cadeira 4kg.\r\nEstrutura em aço com pintura poliester eletrostática.\r\nAssentos e encosto de Polipropileno.'),
(13, 4, 83, 0, 2, 'cadeira dobravel, cadeira que abre e fecha, cadeira para bares e restaurante, cadeira para praia, cadeira para camping, cadeira abre e fecha, cadeira que fecha'),
(14, 4, 106, 0, 2, NULL),
(23, 4, 72, 0, 3, 'Mesa dobrável nas medidas de 70x70\r\nEstrutura em aço com pintura poliester eletrostática garantindo a alta durabilidade e resistência em ambientes abertos.\r\nO tampo da mesa em MDF.\r\nSistema de abertura e fechamento suave, seguro, rápido e prático que não há risco de prender a mão e se machucar como no caso de mesas de madeiras e de ferro.\r\nMuito mais resistente e durável que mesas e cadeiras de plásticos.\r\nIndicado para todos os tipos de ambientes. (Bares, restaurantes, sorveterias, residências, camping...)\r\nCores branco, preto ou marrom. Consulte outras cores.\r\n\r\n\r\n\r\nObservações Finais:\r\n\r\n- Qualidade de exportação.\r\n\r\n- Ótima opção para bares, restaurantes que precisam abrir e fechar todos os dias suas mesas.... produto projetado para isso!\r\n\r\n- Durabilidade em relação as mesas de madeira é incomparável. Não tem as folgas e desgaste que ocorre nas mesas de madeira ficando frouxas e molengas.\r\n\r\n- Nossa empresa tem quase 20 anos de mercado. Realizamos vendas pelo BNDES, FINAME.'),
(24, 4, 73, 0, 3, 'Mesa dobrável 70x70.\r\nEstrutura em aço com pintura poliester eletrostática.\r\nO tampo da mesa em MDF.\r\nSistema de abertura e fechamento suave, seguro, rápido e prático.\r\nResistente e durável.\r\nVárias cores.'),
