(47, 4, 72, 0, 7, 'Banqueta Baixa Espaçosa Dobrável.\r\nProduto diferenciado do que existe no mercado, assento largo e espaçoso, com trava de segurança, muito resistente e de fácil transporte e armazenamento.\r\nFabricada em Aço e assento em polipropileno.\r\nReforçada e de alta qualidade e durabilidade suportando peso de 200kg.\r\nMedidas aberta: Largura 50cm, Altura de 53cm, Profundidade de 43cm\r\nMedidas Fechada: Largura 50cm, Altura de 70cm, espessura fechada de 6,5cm\r\nPeso aproximado do produto: 4kg\r\nVárias opções de cores. Consulte.'),
