(2, 'Footer Links Company', 'footer_links_company', '<div class=\"links\">\r\n<div class=\"block-title\"><strong><span>Empresa</span></strong></div>\r\n<ul>\r\n<li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">Sobre N&oacute;s</a></li>\r\n<li><a href=\"{{store url=\"\"}}contacts/\">Fale Conosco</a></li>\r\n<li><a href=\"{{store url=\"\"}}customer-service/\">Central de Atendimento</a></li>\r\n<li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Pol&iacute;tica de Privacidade</a></li>\r\n</ul>\r\n</div>', '2018-01-26 11:20:55', '2018-01-29 18:55:50', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2018-01-26 11:20:55', '2018-01-26 11:20:55', 1);

