(1, 'Email Novo Pedido', '{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"email-heading\">\r\n                        <h1>Obrigado por comprar na {{var store.getFrontendName()}}.</h1>\r\n                        <p>Assim que seu pedido sair para entrega n&oacute;s enviaremos um email com informa&ccedil;&otilde;es sobre o rastreamento.</p>\r\n                    </td>\r\n                    <td class=\"store-info\">\r\n                        <h4>Ficou com d&uacute;vidas?</h4>\r\n                        <p>\r\n                            {{depend store_phone}}\r\n                            <b>Telefone:</b>\r\n                            <a href=\"tel:{{var phone}}\">{{var store_phone}}</a><br>\r\n                            {{/depend}}\r\n                            {{depend store_hours}}\r\n                            <span class=\"no-link\">{{var store_hours}}</span><br>\r\n                            {{/depend}}\r\n                            {{depend store_email}}\r\n                            <b>Email:</b> <a href=\"mailto:{{var store_email}}\">{{var store_email}}</a>\r\n                            {{/depend}}\r\n                        </p>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\"order-details\">\r\n            <h3>Pedido <span class=\"no-link\">#{{var order.increment_id}}</span></h3>\r\n            <p>Realizado em {{var order.getCreatedAtFormated(\'long\')}}</p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"order-information\">\r\n        <td>\r\n            {{if order.getEmailCustomerNote()}}\r\n            <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n           