(9, 'Comentários do Reembolso', '{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"action-content\">\r\n                        <h1>{{htmlescape var=$order.getCustomerName()}},</h1>\r\n                        <p>O status de seu pedido <span class=\"no-link\">#{{var order.increment_id}}</span> foi atualizado para: <strong>{{var order.getStatusLabel()}}</strong></p>\r\n                        {{if comment}}\r\n                        <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n                            <tr>\r\n                                <td>{{var comment}}</td>\r\n                            </tr>\r\n                        </table>\r\n                        {{/if}}\r\n                        <p>Voc&ecirc; tamb&eacute;m pode acompanhar a situa&ccedil;&atilde;o do seu pedido clicando em <a href=\"{{store url=\"customer/account/\"}}\">acessar sua conta</a>.</p>\r\n                        <p>\r\n                            Se voc&ecirc; tiver alguma d&uacute;vida sobre sua conta ou qualquer outra informa&ccedil;&atilde;o do site, n&atilde;o deixe de entrar em contato atrav&eacute;s do email <a href=\"mailto:{{var store_email}}\">{{var store_email}}</a>\r\n                            {{depend store_phone}} ou por telefone <a href=\"tel:{{var phone}}\">{{var store_phone}}</a>{{/depend}}.\r\n                        </p>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}', NULL, 2, '{{var store.getFrontendName()}}: Reembolso nº {{var creditmemo.increment_id}} atualização', NULL, NULL, '2018-01-31 12:50:22', '2018-01-31 12:50:22', 'sales_email_creditmemo_